m approval is 24 weeks + RBV; 3 Paks total) (Metavir fibrosis stage F0-F2), OR E. Member is treatment experienced (failure after PEG/RBV) without cirrhosis (maximum approval is 12 weeks; 3 Paks total), OR F. Member is treatment experienced (regardless of previous response to PEG/RBV) with cirrhosis (maximum approval is 12 weeks + RBV; 3 Paks total), OR G. Memer is a post liver transplant recipient with normal hepatic function and mild fibrosis (Metavir fibrosis stage F0-F2) (maximum approval is 24 weeks + RBV; 6 Paks total). For initial authorization, 6 week maximum for 12 or 24 week regimen (in order to be eligible for the maximum number of tablets, member must meet both initial and reauthorization criteria). For reauthorization: A. Initial authorization criteria above has been met, AND B. HCV RNA levels have declined > 2 log 10IU/mL at 4 weeks of therapy. Note: There are no treatment guidelines or FDA-approved therapies for re-treatment with Viekira Pak after failure of a Viekira Pak regimen. APPLIES TO Altius, Coventry Healthcare, HealthAmerica, Preferred Health Systems - Pegasys(pegylated interferon alfa-2a) is the CHC preferred pegylated interferon product. New starts on pegylated interferon must use Pegasys. NON-COVERAGE Coverage will NOT be granted for the following: 1. Use not approved by the FDA, 2. The use is unapproved and not supported by the literature or evidence as an accepted off-label use. (see Off-Label Use Policy for determining â€˜accepted useâ€™) 3. Use of maintenance interferon or peg-interferon for chronic suppression of HCV. Results of these trials have indicated that there is no benefit to this therapeutic approach and therefore it will not be covered. 4. Treatment of HCV with ribavirin monotherapy is not effective and not covered. 5. Treatment of HCV with Victrelis / Incivek monotherapy or not in combination with peg-interferon and ribavirin has not been studied. Retreatment in patients previously failed NS3/4A protease inhibitor (Victrelis, Incivek, Olysio) in combination with peg-interferon and ribavirin should not be retreated with another NS3/4A protease inhibitor."},{"source_comments":"HARVONI - For initial authorization, provider must submit medical records documenting the diagnosis of Chronic Hepatitis C with genotype and subtype, if applicable (i.e., Genotype 1a, Genotype 1b; diagnoses further defined below) AND submit medical records documenting one of the following related to staging of liver disease: 1. Liver Biopsy 2. Metavir scores 3. Fibroscan score 4. APRI score 5. Radiological imaging consistent with cirrhosis (i.e., evidence of portal hypertension) 6. Physical findings or clinical evidence consistent with cirrhosis as attested to by the prescribing physician AND meet the criteria specified below: A. Member is not co-infected with hepatitis B, AND B. A documented viral load taken within 6 months of beginning therapy, AND C. Viral load will be submitted by prescriber 12 weeks after completion of therapy, AND D. Members who are cirrhotic, who relapsed after prior Sovaldi containing regimen, AND E. Harvoni should not be taken with P-glycoprotein inducers (i.e., rifampin, St. John’s wort) as these may decrease ledipasvir and sofosbuvir plasma concentrations, leading to reduced therapeutic effect; refer to prescribing information for further drug interaction detail, AND F. A documented diagnosis of hepatitis C Genotype 1a or 1b with or without HIV, AND G. Member has a documented pre-treatment baseline HCV RNA less than 6 million IU/mL, AND member is treatment-naïve without cirrhosis (maximum approval of 8 weeks; 56 tablets) OR H. Member has a documented pre-treatment baseline HCV RNA less than 6 million IU/mL, AND member is treatment-naïve with cirrhosis (maximum approval of 12 weeks; 84 tablets), OR I. Member has a documented pre-treatment baseline HCV RNA greater than 6 million IU/mL, AND member is treatment-naïve with or without cirrhosis (maximum approval of 12 weeks; 84 tablets), OR J.