xperienced without cirrhosis (maximum approval of 12 weeks; 84 tablets), OR C. Member is treatment-experienced (failure after PEG / RBV) with or without cirrhosis (maximum approval of 12 weeks; 84 tablets), OR D. Member is post liver transplantation (maximum approval of 12 weeks; 84 tablets) + RBV, OR E. Member is treatment-naïve post liver transplantation and is RBV ineligible or intolerant** (maximum approval of 24 weeks; 168 tablets), OR F. Member is post liver transplantation AND has decompensated cirrhosis (maximum approval of 12 weeks; 84 tablets) with low dose RBV, OR G. Member has decompensated cirrhosis and may or may not be eligible for liver transplantation and may or may not have Hepatocellular Carcinoma (maximum approval of 12 weeks; 84 tablets) with RBV, OR H. Member has decompensated cirrhosis and may or may not be eligible for liver transplantation and may or may not have Hepatocellular Carcinoma and is RBV ineligible or intolerant** (maximum approval of 24 weeks; 168 tablets), OR I. Member has decompensated cirrhosis and may or may not be eligible for liver transplantation and may or may not have Hepatocellular Carcinoma who has failed a previous Sovaldi containing regimen (maximum approval of 24 weeks; 168 tablets) with RBV OR A. A documented diagnosis of Hepatitis C Genotype 6 with or without HIV, AND B. Member is treatment-naïve without cirrhosis (maximum approval of 12 weeks; 84 tablets), OR C. Member is treatment-experienced (failure after PEG / RBV) with or without cirrhosis (maximum approval of 12 weeks; 84 tablets) For initial authorization, 6 week maximum for 12 or 24 week regimen, 8 week maximum for 8 week regimen (in order to be eligible for the maximum number of tablets, member must meet both initial and reauthorization criteria). For reauthorization: A. Initial authorization criteria above has been met, AND B. HCV RNA levels have declined > 2 log 10 IU/mL at 4 weeks of therapy. **Ribavirin (RBV) ineligible/intolerance is defined as meeting one or more of the following criteria: 1. Neutrophils <750 cells/mm3, results within the past month 2. Hemoglobin <10g/dL, results within the past month 3. Platelets <50,000 cells/mm3, results within the past month 4. Autoimmune hepatitis or other autoimmune condition known to be exacerbated by ribavirin 5. Known hypersensitivity to drugs used to treat HCV INTRON A - Hepatitis C (non-A, Non-B hepatitis) 1. Up to a maximum of 24 weeks of interferon alpha is considered medically necessary for persons with HCV genotypes 2, 3, and 7 through 10. 2. Up to a maximum of 48 weeks of interferon alpha is considered medically necessary for persons with HCV genotypes 1, and 4 through 6 3. Continued treatment with interferon alpha is considered not medically necessary for persons with HCV genotypes 1, and 4 through 6 who have failed to attain an early virologic response is indicated by achievement of at least a 100-fold (2 log 10) decrease in serum HCV from pretreatment baseline) 4. A course of standard interferon alpha in persons with hepatitis C who have failed to respond or relapsed after an adequate course of pegylated interferon alpha or consensus interferon is considered experimental and investigational because of a lack of evidence on the effectiveness of standard interferon in these persons. Note: Upon medical review, extended treatment with interferon alpha beyond these limits may be considered medically necessary for persons with cryoglobulinemia and for liver transplant recipients with recurrent hepatitis C infection. OLYSIO - In order to be eligible for the maximum number of capsules, member must meet both initial and reauthorization criteria. For initial authorization (6 week maximum), provider must submit medical records documenting the diagnosis of Chronic Hepatitis C with genotype and subtype, if applicable (i.e., Genotype 1a, Genotype 1b; diagnoses further defined below) AND submit medical records documenting one of the following related to staging of liver d