ral load taken within 6 months of beginning therapy, AND E. Member has not been previously treated with a HCV Protease Inhibitor (Incivek, Olysio, Victrelis), AND F. Member has not been previously treated with a Sovaldi containing regimen, AND G. Viral load will be submitted by prescriber 12 weeks after completion of therapy, AND H. Viekira Pak should not be taken with alfuzosin HCL, carbamazepine, phenytoin, phenobarbital, gemfibrozil, rifampin, ergotamine, dihydroergotamine, ergonovine, methylergonovine, ethinyl estradiol-containing medications such as combined oral contraceptives, St. John’s Wort, lovastatin, simvastatin, pimozide, efavirenz, sildenafil when dosed as Revatio for the treatment of pulmonary arterial hypertension, triazolam, and orally administered midazolam AND I. A documented diagnosis of hepatitis C Genotype 1a with or without HIV, AND J. Member is treatment naïve without cirrhosis (max time of approval 12 weeks + RBV; 3 Paks total), OR K. Member is treatment naïve with cirrhosis (max time of approval 24 weeks + RBV; 6 Paks total), OR L. Member is treatment naïve post liver transplant with or without compensated cirrhosis (max time of approval 24 weeks + RBV; 6 Paks total) (Metavir fibrosis stage F0-F2), OR M. Member is treatment experienced (failure after PEG/RBV) without cirrhosis (maximum approval is 12 weeks + RBV; 3 Paks total), OR N. Member is treatment experienced (partial responder/relapse to PEB/RBV) with cirrhosis (maximum approval is 12 weeks + RBV; 3 Paks total), OR O. Member is treatment experienced (NON/NULL responder to PEG/RBV) with cirrhosis (maximum approval is 24 weeks + RBV; 6 Paks total) OR A. A documented diagnosis of hepatitis C Genotype 1b with or without HIV, AND B. Member is treatment naïve without cirrhosis (maximum approval is 12 weeks; 3 Paks total), OR C. Member is treatment naïve with cirrhosis (maximum approval is 12 weeks + RBV; 3 Paks total), OR D. Member is treatment naïve post liver transplant with or without cirrhosis (compensated only) (maximum approval is 24 weeks + RBV; 3 Paks total) (Metavir fibrosis stage F0-F2), OR E. Member is treatment experienced (failure after PEG/RBV) without cirrhosis (maximum approval is 12 weeks; 3 Paks total), OR F. Member is treatment experienced (regardless of previous response to PEG/RBV) with cirrhosis (maximum approval is 12 weeks + RBV; 3 Paks total), OR G. Memer is a post liver transplant recipient with normal hepatic function and mild fibrosis (Metavir fibrosis stage F0-F2) (maximum approval is 24 weeks + RBV; 6 Paks total). For initial authorization, 6 week maximum for 12 or 24 week regimen (in order to be eligible for the maximum number of tablets, member must meet both initial and reauthorization criteria). For reauthorization: A. Initial authorization criteria above has been met, AND B. HCV RNA levels have declined > 2 log 10IU/mL at 4 weeks of therapy. Note: There are no treatment guidelines or FDA-approved therapies for re-treatment with Viekira Pak after failure of a Viekira Pak regimen. APPLIES TO Altius, Coventry Healthcare, HealthAmerica, Preferred Health Systems - Pegasys(pegylated interferon alfa-2a) is the CHC preferred pegylated interferon product. New starts on pegylated interferon must use Pegasys. NON-COVERAGE Coverage will NOT be granted for the following: 1. Use not approved by the FDA, 2. The use is unapproved and not supported by the literature or evidence as an accepted off-label use. (see Off-Label Use Policy for determining ‘accepted use’) 3. Use of maintenance interferon or peg-interferon for chronic suppression of HCV. Results of these trials have indicated that there is no benefit to this therapeutic approach and therefore it will not be covered. 4. Treatment of HCV with ribavirin monotherapy is not effective and not covered. 5. Treatment of HCV with Victrelis / Incivek monotherapy or not in combination with peg-interferon and ribavirin has not been studied. Retreatment in patients previously failed NS3/4